import { Link } from 'react-router-dom';
import './header.css';

const Header = () => (
    <header>
        <nav className="nav">
            <Link to="/"><p className="list-text">Home</p></Link>
            <Link to="/about"><p className="list-text">About</p></Link>
            <Link to="/contact"><p className="list-text">Contact</p></Link>
            <Link to="/projects"><p className="list-text">Projects</p></Link>
            <Link to="/skills"><p className="list-text">Skills</p></Link>
            <Link to="/education"><p className="list-text">Education</p></Link>
            <Link to="/experience"><p className="list-text">Experience</p></Link>
        </nav>
    </header>
);

export default Header;
